Variables expect anything that implement Display. If the key use plurals it expect the type of the count, if you set the type to f32, it expect a f32. Components expect a value that implement leptos_i18::display::DisplayComponent, you can find some type made to help the formatting in the display module, such as DisplayComp. String and &str implement this trait such that // hello_world = "Hello <b>World</b> !" let hw = td_string(Locale::en, hello_world, <b> = "span");
assert_eq!(hw, "Hello <span>World</span> !"); The DisplayComp struct let you pass leptos attributes: let attrs = [("id", leptos::Attribute::String("my_id".into()))];
let b = DisplayComp::new("div", &attrs);
let hw = td_string!(Locale::en, hello_world, <b>);
assert_eq!(hw, "Hello <div id=\"my_id\">World</div> !"); If you want finer control over the formatting, you can create your own types implementing the DisplayComponent trait, or you can pass this abomination of a function: Fn(&mut core::fmt::Formatter, &dyn Fn(&mut core::fmt::Formatter) -> core::fmt::Result) -> core::fmt::Result which basically let you do this: use core::fmt::{Formatter, Result}; fn render_b(f: &mut Formatter, child: &dyn Fn(&mut Formatter) -> Result) -> Result { write!(f, "<div id=\"some_id\">")?; child(f)?; // format the children write!(f, "</div>")
} // hello_world = "Hello <b>World</b> !"
let hw = td_string!(Locale::en, hello_world, <b> = render_b);
assert_eq!(hw, "Hello <div id=\"some_id\">World</div> !"); If you look closely, there is no Clone or 'static bounds for any arguments, but they are captured by the value returned by the macro, so the returned value as a lifetime bound to the "smallest" lifetime of the arguments.

